import React from 'react'
import {Field, reduxForm} from "redux-form";

const Login = (props) => {

    return (
        <div>
            <h1>Login</h1>
            <ReduxForm />
        </div>
    )
}


const LoginForm = (props) => {

    return (
        <form onSubmit={props.handleSubmit}>
            <div>
                <Field name={'login'} component={'input'} placeholeder='login..'/>
            </div>
            <div>
                <Field name={'password'} component={'input'} placeholeder='password..'/>
            </div>
            <div>
                <Field name={'rememberMe'} component={'input'} type={'checkbox'} />
            </div>
            <div>
                <button>Login</button>
            </div>
        </form>
    )
}

const ReduxForm = reduxForm({
    form: 'login'
})(LoginForm)

export default Login
